    fun add(value: Comparable<*>) {
        val newNode = Node(value)
        newNode.next = head
        head = newNode
    }

    fun reverseRecurrsive() {
        head = reverseRecurrsive(head)
    }

    private fun reverseRecurrsive(node: Node?): Node? {
        if (node == null || node.next == null) {
            return node
        }
        val reversedNext = reverseRecurrsive(node.next)
        node.next = null
        reversedNext?.next = node
        return reversedNext
    }

    private class Node<T>(val value: T) {
        var next: Node<T>? = null
    }
}

