fun maxSumAfterPartitioning(arr: IntArray, k: Int): Int {
    val n = arr.size
    val dp = Array(n + 1) { IntArray(n + 1) }
    for (i in 1..n) {
        for (j in 1..k) {
            var max = 0
            for (l in 0 until j) {
                max = Math.max(max, arr[i - 1 - l])
            }
            dp[i][j] = Math.max(dp[i - 1][j], dp[i - 1][j - 1] + max * j)
        }
    }
    return dp[n][k]
}

