class SegmentTree(val arr: Array<Int>) {
    private val tree: Array<Int> = Array(4 * arr.size) { 0 }

    init {
        buildTree(0, arr.size - 1, 0)
    }

    private fun buildTree(left: Int, right: Int, index: Int) {
        if (left == right) {
            tree[index] = arr[left]
            return
        }

        val mid = (left + right) / 2
        buildTree(left, mid, 2 * index + 1)
        buildTree(mid + 1, right, 2 * index + 2)
        tree[index] = tree[2 * index + 1] + tree[2 * index + 2]
    }

    fun getSum(left: Int, right: Int): Int {
        return getSumHelper(left, right, 0, arr.size - 1, 0)
    }

    private fun getSumHelper(left: Int, right: Int, treeLeft: Int, treeRight: Int, index: Int): Int {
        if (left <= treeLeft && treeRight <= right) {
            return tree[index]
        }

        if (treeRight < left || treeLeft > right) {
            return 0
        }

        val mid = (treeLeft + treeRight) / 2
        return getSumHelper(left, right, treeLeft, mid, 2 * index + 1) +
               getSumHelper(left, right, mid + 1, treeRight, 2 * index + 2)
    }
}

