    private val parent: IntArray
    private val rank: IntArray

    init {
        parent = IntArray(size) { it }
        rank = IntArray(size) { 0 }
    }

    fun union(p: Int, q: Int) {
        val rootP = find(p)
        val rootQ = find(q)
        if (rootP == rootQ) return
        if (rank[rootP] < rank[rootQ]) {
            parent[rootP] = rootQ
        } else {
            parent[rootQ] = rootP
            if (rank[rootP] == rank[rootQ]) {
                rank[rootP]++
            }
        }
    }

    fun find(p: Int): Int {
        if (parent[p] != p) {
            parent[p] = find(parent[p])
        }
        return parent[p]
    }
}

